import React from 'react';

class TodoListFooter extends React.Component {
    render = () => {
        return (
        <div className="todoListFooter">
        <button>All</button>
        <button>Completed</button>
        <button>Active</button>
        </div>
        );
    }
}



export default TodoListFooter;
